  `horasClase` varchar(4) COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'HC en el excel',
  `horasLaboratorio` varchar(4) COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'HL en el excel',
