  `alumnosInscritos` int(11) NOT NULL,
  PRIMARY KEY (`CRN`,`materia`,`idDepartamento`,`indexUsuario`,`idPeriodo`,`curso`),
  KEY `GrupoUsuario` (`indexUsuario`,`idDepartamento`),
  KEY `GrupoPeriodo` (`idPeriodo`),
