CREATE TABLE `horarios` (
  `idHorarios` int(11) NOT NULL AUTO_INCREMENT,
  `CRN` int(11) NOT NULL,
  `materia` varchar(5) COLLATE utf8_spanish_ci NOT NULL,
  `curso` varchar(5) COLLATE utf8_spanish_ci NOT NULL,
  `idDepartamento` int(11) NOT NULL,
  `indexUsuario` int(11) NOT NULL,
  `idPeriodo` int(11) NOT NULL,
  `salon` varchar(10) COLLATE utf8_spanish_ci NOT NULL,
  `diaSemana` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  `horaInicio` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  `horaFin` varchar(20) COLLATE utf8_spanish_ci NOT NULL,
  PRIMARY KEY (`idHorarios`,`CRN`,`materia`,`idDepartamento`,`indexUsuario`,`idPeriodo`,`curso`),
  KEY `HGrupos` (`CRN`,`materia`,`idDepartamento`,`indexUsuario`,`idPeriodo`,`curso`),
  CONSTRAINT `HGrupos` FOREIGN KEY (`CRN`, `materia`, `idDepartamento`, `indexUsuario`, `idPeriodo`, `curso`) REFERENCES `grupo` (`CRN`, `materia`, `idDepartamento`, `indexUsuario`, `idPeriodo`, `curso`) ON DELETE CASCADE ON UPDATE CASCADE
